description:
Для объема аквариума - от 120 до 350 л

Циркуляция фильтра – 620 л/час;
Высота подъема воды – 1.8 м.вод.ст;
Объем фильтра – 4,0 л;
Объем контейнера -4,8 л;
Потребляемая мощность – 15 Вт;
Размеры (диаметр х высота) – 185х370 мм.
Комплектующие:

Шланг 3 м 12/16 4;
присоски с клипсой для шланга 12/16 мм;
1 заборная трубка с сетчатой насадкой;
1 флейта;
1 сливное колено;
6 губок грубой очистки;
1 губка тонкой очистки;
1 губка с активированным углем;
комплект наполнителей.

Пьезокомпрессор для аквариума объемом 40 - 80 л. Идеальный компрессор для любого помещения.

Благодаря пьезоэлектрической технологии компрессор имеет низкое энергопотребление и не требует замены мембран.

Полный комплет, включая распылитель, обратный клапан и шланг (1 м);

Легко прикрепляется на присоску с внешней стороны аквариума, что предотвращает передачу вибраций

Компактная конструкция имеет сверхмалые размеры – 9,5 х 6 х 3,5 см (с присосками);

Тихий: уровень шума

